        "created": 1412253219000, 
        "description": "<p>At its core, User Experience (UX) is defined as how someone feels about using a product, system, or service. Regardless of what we\u2019re designing--a website, an Android app, or a toaster--we all strive to make our designs useful, easy to use, and enjoyable to use. But how exactly do we make something useful, easy to use, and enjoyable? How do we know if the target audience is having a good or bad experience? This class will arm you with the essential tips to find those answers.</p> <p>This class is for anyone who currently makes (or wants to learn how to make) websites, mobile apps, or other software. If you\u2019re a developer, a designer, a project manager, a content creator, or something else, you can integrate UX research and design into your practice.</p> <p>The contents that this class will cover include:</p> <p>\u2022 \u00a0Fundamental concepts of user experience design (what UX is and why you should care)</p> <p>\u2022 Creating user personas</p> <p>\u2022 Identifying usability problems and prioritizing solutions</p> <p>\u2022 How to design and run usability tests</p> <p>\u2022 Getting useful feedback from your users</p> <p>\u2022 Information Architecture and interaction design</p> <p>\u2022 Where UX fits with project management methodologies</p> <p>\u2022 And much, much more!</p> <p>This is a hands on course which will give you actionable tools to get started with user experience in your work day! Be prepared to sketch, talk and brainstorm with your peers. Don't forget to bring something to write with and take notes!</p> <p><b>About the Teachers:</b></p> <p><img src=\"http://photos4.meetupstatic.com/photos/event/a/2/600_365640162.jpeg\" /></p> <p>Ramla Mahmood is a web designer at Vox Media, publisher of SB Nation, The Verge, Polygon, Curbed, Eater, Racked and Vox. Prior to that she worked at the Collaborative Learning Hub at George Mason University where she used to teach into to HTML/CSS and certification programs in Adobe Creative Suite. In her free time, she loves to travel, collect books and learn new things.</p> <p><br/><img src=\"http://photos1.meetupstatic.com/photos/event/b/6/b/4/600_416446772.jpeg\" /></p> <p>Afreen Habib is a User Experience Designer and Researcher. She creates great mobile and web experiences through user-centered design methods and eye-tracking studies at Apollo Matrix, Inc, a mobile design and development agency. At George Mason University she runs usability tests as a human factors researcher focusing on social decision-making and human-computer interaction studies.</p> <p>\n\n\n\n<b>Please bring the following prior to class:\u00a0</b></p> <p>\u2022\u00a0Something to write with: pen/paper, laptop or tablet will all work.</p> <p>\n\n\n<img src=\"http://photos3.meetupstatic.com/photos/event/b/b/a/0/600_416448032.jpeg\" /></p> <p><a href=\"http://www.addthis.com\">AddThis</a> is generously providing space at their headquarters in Vienna, VA.\u00a0</p> <p>\n\n\n<b>Parking:</b> There's ample free parking in front and around the back of the building.\u00a0</p> <p>\n\n\n<b>Refund Policy:</b>\u00a0Your payment guarantees your seat in the course. If something changes after registration and you cannot attend the course, your seat is yours to sell or give to someone else - just please let us know who! \u00a0As a rule we don't offer refunds or credits; \u00a0Instead your class fee will go toward our chapter fund which we will use to establish a scholarship fund going forward. \u00a0 That said, please do reach out and let us know if you have extenuating circumstances.</p>", 
