        "description": "<p><img src=\"http://photos1.meetupstatic.com/photos/event/5/9/d/a/600_394763002.jpeg\" /></p> <p><b>MoDev is back in October with a Wearables + Things Conference Oct 20-21!\u00a0</b></p> <p>Use code <b>GDI14\u00a0</b>for a 15% discount on tickets!\u00a0</p> <p>\n\n\nThe Wearables + Things conference is two days of essential talks, training, and product demos for anyone developing or designing for the Wearables and Internet of Things ecosystems. \u00a0</p> <p>$14B market for wearables alone in 2014 and more than 100 billion devices connected to the Internet by 2020 confirms that this IS next major technology revolution. From smart watches to connected devices, the leaders are being established and the opportunity for OEMs, developers, designers and service providers is now. Join us at Wearables + Things in October for two days of inspired action and training designed to help you take the reins of this market and ride the wave of the next decade.</p> <p>Join industry leaders including Adidas, Sony, Amazon, Bluetooth, Intel, and more. See the full schedule and speaker list at\u00a0<a href=\"http://modevwear.com/\">modevwear.com</a></p> <p><br/><b>Please visit the conference website to register. \u00a0RSVPing here on meetup will NOT register you! \u00a0</b></p>", 
