        "created": 1412113433000, 
        "description": "<p>We are in DC. \u00a0The capital is here along with a whole slew of federal government agencies and state agencies for the tri-state area. \u00a0What does that equate to? \u00a0Lots of government jobs.\u00a0</p> <p><br/>Do you know what collaboration platform is most prevalent in the DMV area? \u00a0Microsoft SharePoint. \u00a0Do a search for SharePoint jobs, and you will find an abundance of jobs in our area. \u00a0But guess what? \u00a0There are not enough people qualified to take these jobs. \u00a0</p> <p>In addition to direct government jobs there are loads of government contractors, small businesses, and nonprofits in the area. \u00a0What technology is taking off with those right now? \u00a0Cloud. \u00a0Microsoft\u2019s Office 365 is a cloud platform that is taking off and being adopted by more and more of these organizations every day. \u00a0This\u00a0includes SharePoint and some other powerful tools, like Lync which is used for instant messaging, presence, web conferencing and more!</p> <p>Why did I just go through saying all of that? \u00a0I prefaced with all of that to say this:\u00a0<b>Learning about these technologies are crucial to the market in which we live</b>. \u00a0In this class, you will get a taste of how to use these tools, Office 365, Lync, and SharePoint, as an end user\u2026 And, don\u2019t worry, this is only the beginning!</p> <p>\n\n\n<b>About the teacher:</b></p> <p><img src=\"http://photos2.meetupstatic.com/photos/event/3/b/d/0/600_416055312.jpeg\" /></p> <p>Nikkia\u00a0Carter is the owner and CEO of CMS, LLC, a small woman and minority owned company in King George, VA.\u00a0Nikkia's company is a Microsoft Partner, Cloud Accelerate Partner, SMB Champion, and Value Added Reseller business technology consulting, development, and training. Her company is also a Value Added Reseller of Constant Contact, Hootsuite, and BrainStorm and\u00a0Nikkia\u00a0is a CompTIA Certified Technical Trainer and a Microsoft certified Professional. \u00a0Nikkia\u00a0has industry experience since 2001 in software, web (intranet), Office 365, InfoPath, and SharePoint development.\u00a0</p> <p>\n\n\n<b>Please bring/install the following on your computer prior to class:\u00a0</b></p> <p>\u2022\u00a0Your laptop and charger. Note: A netbook or tablet is NOT a substitute. \u00a0</p> <p>\n\n\n<img src=\"http://photos2.meetupstatic.com/photos/event/1/1/f/0/600_365644592.jpeg\" /></p> <p><a href=\"http://disruption.vc/\">&lt;/a&gt;</p> <p>&lt;a href=\"http://disruption.vc/\"&gt;Disruption Corporation</a>\u00a0is generously providing space at their Crystal Tech Fund offices in Crystal City for our classes! \u00a0They are an amazing partner, and we encourage you to Tweet your thanks\u00a0<a href=\"https://twitter.com/disruptioncorp\">@disruptioncorp</a></p> <p>\n\n\n<b>Food &amp; Drinks:</b></p> <p>Please bring snacks and a bagged lunch. \u00a0We do not have a food sponsor for this workshop!\u00a0</p> <p><b>Parking:</b></p> <p>There's an underground parking garage at the intersection of Crystal Dr. and 23rd St. - you can park there as it's directly under the building (follow signs to bldg 2231). \u00a0Parking is free on weekends. \u00a0There is also a free garage across the street. \u00a0</p> <p>Alternately, you can take the metro to the Crystal City metro station on yellow/blue lines. \u00a0The office is only a couple short blocks away. \u00a0</p> <p>\n\n\n<b>Refund Policy:\u00a0</b>Your payment guarantees your seat in the course. If something changes after registration and you cannot attend the course, your seat is yours to sell or give to someone else - just please let us know who! \u00a0As a rule we don't offer refunds or credits; \u00a0Instead your class fee will go toward our chapter fund which we will use to establish a scholarship fund going forward. \u00a0 That said, please do reach out and let us know if you have extenuating circumstances.</p>", 
